import React from 'react';
import { Card, CardContent, Typography, Box, Grid, Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from '@mui/material';
import { BarChart } from '@mui/x-charts/BarChart';
import { LineChart } from '@mui/x-charts/LineChart';
import { PieChart } from '@mui/x-charts/PieChart';

const ProjectionsChart = () => {
  const data = [20, 35, 25, 45, 30, 40, 35, 50, 45, 35, 40, 30];
  const xLabels = ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep', 'Oct', 'Nov', 'Dec'];

  return (
    <Card sx={{ height: 300 }}>
      <CardContent sx={{ p: 2.5, height: '100%' }}>
        <Typography variant="body1" sx={{ mb: 2, fontWeight: 600, fontSize: '1rem' }}>
          Projections vs Actuals
        </Typography>
        <Box sx={{ height: 220, width: '100%' }}>
          <BarChart
            series={[{ data, color: '#3b82f6' }]}
            xAxis={[{ data: xLabels, scaleType: 'band', tickLabelStyle: { fontSize: 12 } }]}
            height={220}
            margin={{ left: 20, right: 20, top: 20, bottom: 30 }}
            slotProps={{
              bar: {
                rx: 4,
              },
            }}
          />
        </Box>
      </CardContent>
    </Card>
  );
};

const RevenueChart = () => {
  const currentWeek = [12, 8, 10, 15, 18, 20];
  const previousWeek = [8, 15, 17, 12, 10, 22];
  const xLabels = ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun'];

  return (
    <Card sx={{ height: 300, backgroundColor: '#f8fafc' }}>
      <CardContent sx={{ p: 2.5, height: '100%' }}>
        <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start', mb: 2 }}>
          <Typography variant="body1" sx={{ fontWeight: 600, fontSize: '1rem', color: '#374151' }}>
            Revenue
          </Typography>
          <Box sx={{ display: 'flex', gap: 3, fontSize: '0.75rem' }}>
            <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
              <Box sx={{ width: 8, height: 8, borderRadius: '50%', backgroundColor: '#000000' }} />
              <Typography variant="body2" sx={{ fontSize: '0.8rem', color: '#374151' }}>
                Current Week
              </Typography>
              <Typography variant="body2" fontWeight={600} sx={{ fontSize: '0.8rem', color: '#374151' }}>
                $58,211
              </Typography>
            </Box>
            <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
              <Box sx={{ width: 8, height: 8, borderRadius: '50%', backgroundColor: '#a7c7e7' }} />
              <Typography variant="body2" sx={{ fontSize: '0.8rem', color: '#374151' }}>
                Previous Week
              </Typography>
              <Typography variant="body2" fontWeight={600} sx={{ fontSize: '0.8rem', color: '#374151' }}>
                $68,768
              </Typography>
            </Box>
          </Box>
        </Box>
        <Box sx={{ height: 220, width: '100%' }}>
          <LineChart
            series={[
              { 
                data: currentWeek, 
                color: '#000000', 
                curve: 'natural',
                connectNulls: true
              },
              { 
                data: previousWeek, 
                color: '#a7c7e7', 
                curve: 'natural',
                connectNulls: true
              },
            ]}
            xAxis={[{ 
              data: xLabels, 
              scaleType: 'band', 
              tickLabelStyle: { fontSize: 12, fill: '#9ca3af' },
              axisLine: false,
              tickLine: false
            }]}
            yAxis={[{
              tickLabelStyle: { fontSize: 12, fill: '#9ca3af' },
              axisLine: false,
              tickLine: false,
              tickFormatter: (value) => `${value}M`
            }]}
            height={220}
            margin={{ left: 40, right: 20, top: 20, bottom: 40 }}
            grid={{ horizontal: true, vertical: false }}
          />
        </Box>
      </CardContent>
    </Card>
  );
};

const LocationChart = () => {
  const locations = [
    { name: 'New York', value: '72K' },
    { name: 'San Francisco', value: '39K' },
    { name: 'Sydney', value: '25K' },
    { name: 'Singapore', value: '61K' },
  ];

  return (
    <Card sx={{ height: 300, backgroundColor: '#f8fafc' }}>
      <CardContent sx={{ p: 2.5, height: '100%' }}>
        <Typography variant="body1" sx={{ mb: 2, fontWeight: 600, fontSize: '1rem', color: '#374151' }}>
          Revenue by Location
        </Typography>
        <Box sx={{ position: 'relative', height: '140px', mb: 2 }}>
          {/* World Map SVG */}
          <svg
            width="100%"
            height="100%"
            viewBox="0 0 300 150"
            style={{ backgroundColor: '#f8fafc' }}
          >
            {/* Simplified world map paths */}
            <path
              d="M20,40 Q30,35 50,40 L70,45 Q80,50 90,45 L110,50 Q120,55 140,50 L160,55 Q170,60 190,55 L210,60 Q220,65 240,60 L260,65 Q270,70 280,65 L280,120 Q270,115 260,120 L240,115 Q230,110 210,115 L190,110 Q180,105 160,110 L140,105 Q130,100 110,105 L90,100 Q80,95 70,100 L50,95 Q40,90 30,95 L20,90 Z"
              fill="#d1d5db"
              opacity="0.6"
            />
            <path
              d="M50,70 Q60,65 80,70 L100,75 Q110,80 130,75 L150,80 Q160,85 180,80 L200,85 Q210,90 230,85 L250,90 Q260,95 270,90 L270,130 Q260,125 250,130 L230,125 Q220,120 200,125 L180,120 Q170,115 150,120 L130,115 Q120,110 100,115 L80,110 Q70,105 60,110 L50,105 Z"
              fill="#a7c7e7"
              opacity="0.4"
            />

            {/* Location dots */}
            <circle cx="60" cy="50" r="3" fill="#000000" />
            <circle cx="80" cy="55" r="3" fill="#000000" />
            <circle cx="200" cy="85" r="3" fill="#000000" />
            <circle cx="220" cy="80" r="3" fill="#000000" />
          </svg>
        </Box>
        <Box>
          {locations.map((location, index) => (
            <Box
              key={index}
              sx={{
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'space-between',
                mb: 1,
                pb: 1,
                borderBottom: '1px solid #e5e7eb',
              }}
            >
              <Typography variant="body2" sx={{ fontSize: '0.8rem', color: '#374151' }}>
                {location.name}
              </Typography>
              <Typography variant="body2" fontWeight={600} sx={{ fontSize: '0.8rem', color: '#374151' }}>
                {location.value}
              </Typography>
            </Box>
          ))}
        </Box>
      </CardContent>
    </Card>
  );
};

const TopProducts = () => {
  const products = [
    { name: 'ASOS Ridley High Waist', price: '$79.49', sold: 82, revenue: '$6,518.18' },
    { name: 'Marco Lightweight Shirt', price: '$128.50', sold: 37, revenue: '$4,754.50' },
    { name: 'Half Sleeve Shirt', price: '$39.99', sold: 64, revenue: '$2,559.36' },
    { name: 'Lightweight Jacket', price: '$20.00', sold: 184, revenue: '$3,680.00' },
    { name: 'Marco Shoes', price: '$79.49', sold: 64, revenue: '$1,965.81' },
  ];

  return (
    <Card sx={{ height: 300 }}>
      <CardContent sx={{ p: 2.5, height: '100%' }}>
        <Typography variant="body1" sx={{ mb: 2, fontWeight: 600, fontSize: '1rem' }}>
          Top Selling Products
        </Typography>
        <TableContainer sx={{ height: 'calc(100% - 40px)' }}>
          <Table size="small">
            <TableHead>
              <TableRow>
                <TableCell sx={{ fontWeight: 600, fontSize: '0.7rem', color: 'text.secondary', border: 'none', pb: 1 }}>
                  Name
                </TableCell>
                <TableCell align="center" sx={{ fontWeight: 600, fontSize: '0.7rem', color: 'text.secondary', border: 'none', pb: 1 }}>
                  Price
                </TableCell>
                <TableCell align="center" sx={{ fontWeight: 600, fontSize: '0.7rem', color: 'text.secondary', border: 'none', pb: 1 }}>
                  Quantity
                </TableCell>
                <TableCell align="right" sx={{ fontWeight: 600, fontSize: '0.7rem', color: 'text.secondary', border: 'none', pb: 1 }}>
                  Amount
                </TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {products.map((product, index) => (
                <TableRow key={index} sx={{ '&:last-child td': { border: 0 } }}>
                  <TableCell sx={{ fontSize: '0.8rem', border: 'none', py: 1 }}>
                    {product.name}
                  </TableCell>
                  <TableCell align="center" sx={{ fontSize: '0.8rem', color: 'text.secondary', border: 'none', py: 1 }}>
                    {product.price}
                  </TableCell>
                  <TableCell align="center" sx={{ fontSize: '0.8rem', color: 'text.secondary', border: 'none', py: 1 }}>
                    {product.sold}
                  </TableCell>
                  <TableCell align="right" sx={{ fontSize: '0.8rem', fontWeight: 500, border: 'none', py: 1 }}>
                    {product.revenue}
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </CardContent>
    </Card>
  );
};

const TotalSalesChart = () => {
  const data = [
    { id: 0, value: 38.6, label: 'Direct', color: '#1f2937' },
    { id: 1, value: 22.5, label: 'Affiliate', color: '#10b981' },
    { id: 2, value: 30.8, label: 'Sponsored', color: '#8b5cf6' },
    { id: 3, value: 8.1, label: 'E-mail', color: '#06b6d4' },
  ];

  const salesData = [
    { label: 'Direct', value: '$300.56', color: '#1f2937' },
    { label: 'Affiliate', value: '$135.18', color: '#10b981' },
    { label: 'Sponsored', value: '$154.02', color: '#8b5cf6' },
    { label: 'E-mail', value: '$48.96', color: '#06b6d4' },
  ];

  return (
    <Card sx={{ height: 300 }}>
      <CardContent sx={{ p: 2.5, height: '100%' }}>
        <Typography variant="body1" sx={{ mb: 2, fontWeight: 600, fontSize: '1rem' }}>
          Total Sales
        </Typography>
        <Box sx={{ display: 'flex', alignItems: 'center', gap: 2, height: 'calc(100% - 40px)' }}>
          <Box sx={{ width: 120, height: 120, position: 'relative' }}>
            <PieChart
              series={[
                {
                  data,
                  innerRadius: 35,
                  outerRadius: 60,
                  paddingAngle: 2,
                },
              ]}
              width={120}
              height={120}
            />
            <Box
              sx={{
                position: 'absolute',
                top: '50%',
                left: '50%',
                transform: 'translate(-50%, -50%)',
                textAlign: 'center',
              }}
            >
              <Typography variant="body2" fontWeight={600} sx={{ fontSize: '0.9rem' }}>
                38.6%
              </Typography>
            </Box>
          </Box>
          <Box sx={{ flex: 1, pl: 1 }}>
            {salesData.map((item, index) => (
              <Box
                key={index}
                sx={{
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'space-between',
                  mb: 1,
                }}
              >
                <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                  <Box
                    sx={{
                      width: 8,
                      height: 8,
                      borderRadius: '50%',
                      backgroundColor: item.color,
                    }}
                  />
                  <Typography variant="body2" sx={{ fontSize: '0.8rem' }}>
                    {item.label}
                  </Typography>
                </Box>
                <Typography variant="body2" fontWeight={500} sx={{ fontSize: '0.8rem' }}>
                  {item.value}
                </Typography>
              </Box>
            ))}
          </Box>
        </Box>
      </CardContent>
    </Card>
  );
};

const Charts = () => {
  return (
    <>
      <Grid container spacing={2} sx={{ mb: 2 }}>
        <Grid item xs={12} md={8.4}>
          <RevenueChart />
        </Grid>
        <Grid item xs={12} md={3.6}>
          <LocationChart />
        </Grid>
      </Grid>
      <Grid container spacing={2} sx={{ mb: 2 }}>
        <Grid item xs={12} lg={6}>
          <TotalSalesChart />
        </Grid>
        <Grid item xs={12} lg={6}>
          {/* Placeholder for future chart */}
          <Card sx={{ height: 300, backgroundColor: '#f8fafc' }}>
            <CardContent sx={{ p: 2.5, height: '100%', display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
              <Typography variant="body1" color="text.secondary">
                Chart Placeholder
              </Typography>
            </CardContent>
          </Card>
        </Grid>
      </Grid>
      <Grid container spacing={2} sx={{ mb: 2 }}>
        <Grid item xs={12}>
          <TopProducts />
        </Grid>
      </Grid>
    </>
  );
};

export default Charts;
